import styled from "styled-components";
import IconContext from "react-icons";

function MenuIcon({ outlineIcon, fullIcon, name }) {
  console.log("oi");
  return (
    <IconWrapper>
      <IconContext.Provider
        value={{ color: "blue", className: "global-class-name" }}
      >
        <div>
          <outlineIcon />
        </div>
      </IconContext.Provider>
      ;<IconName>{name}</IconName>
    </IconWrapper>
  );
}

const iconNames = [
  { outlineIcon: "HiOutlineHome", fullIcon: "HiHome", name: "Início" },
  { outlineIcon: "RiMovie2Line", fullIcon: "RiMovie2Fill", name: "Filmes" },
  {
    outlineIcon: "HiOutlineBookOpen",
    fullIcon: "BsFillTvFill",
    name: "Livros",
  },
  { outlineIcon: "IoTvOutline", fullIcon: "HiBookOpen", name: "Séries" },
  { outlineIcon: "TfiMenuAlt", fullIcon: "TfiMenuAlt", name: "Mais" },
];

export default function BottomNavigationMenu() {
  console.log("hello");
  return (
    <MenuWrapper>
      {iconNames.map((element) => {
        return (
          <MenuIcon
            outlineIcon={element.outlineIcon}
            fullIcon={element.fullIcon}
            name={element.name}
          />
        );
      })}
    </MenuWrapper>
  );
}

const MenuWrapper = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  display: flex;
  height: 100px;
  width: 100vw;
  background-color: magenta;
  align-items: center;
  justify-content: space-around;
`;

const IconWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: auto;
  height: 60px;
`;

const IconName = styled.h1`
  font-size: 20px;
`;
